import React from "react";

const Layout = ({ themes, children }) => {
  return (
    <div>
      {themes.map((item, index) => (
        <h1 key={index} className={item}>
          <a
            href={item
              .toString()
              .match(/\d+(.*)$/)[0]
              .replace(",", "")}
          >
            {item
              .toString()
              .match(/\d+(.*)$/)[1]
              .replace(",", "")}
          </a>
        </h1>
      ))}
      {children}
      <footer>
        <h1>2023 - KosmoNews</h1>
      </footer>
    </div>
  );
};

export default Layout;
